import React from 'react'
import './App.css'
import {Table} from "./components/table/Table";
import {Card} from "./components/card/Card";

let num = 16;
let arr = [];
for (let i = 1; i <= num; i++) {
    arr.push(<Card s={i + ".jpg"} key={i}/>);
}

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            cards: arr,
            status: true
        }
    }
    timer(status) {
        setTimeout(() => {setState()}, 1200)
    }
    render() {
        return <Table>
            {this.state.cards}
        </Table>
    }
}

export default App
